import React from "react";
import logo from "../assets/images/villa_rouge.jpg";

export default function Villarouge() {
    return (
      <main style={{ padding: "1rem 0" }}>
        <h2>Page de la Villa Rouge</h2>
        <div>
        <img src={logo} alt="Logo" />
        </div>
      </main>
    );
  }
